-- Set nhan vien co ma tu 293-300 lam truong phong
BEGIN
    FOR ROW IN (SELECT * FROM NHANVIEN WHERE MANV IN ('293', '294', '295', '296', '297', '298', '299', '300')) LOOP
        UPDATE PHONGBAN
        SET TRPHG = ROW.MANV
        WHERE MAPB = ROW.PHG;
    END LOOP;
