-- DEAN DATA
TRUNCATE TABLE DEAN;


-- PHANCONG DATA
TRUNCATE TABLE PHANCONG;

BEGIN
    FOR ROW IN
    (
        SELECT MANV, MADA, NGAYBD
        FROM NHANVIEN, DEAN
        WHERE PHG = PHONG
    )
    LOOP
        EXECUTE IMMEDIATE 'INSERT INTO PHANCONG (MANV, MADA, THOIGIAN) VALUES (:1, :2, TO_DATE(:3, ''YYYY-MM-DD''))'
            USING ROW.MANV, ROW.MADA, TO_CHAR(ROW.NGAYBD, 'YYYY-MM-DD');
    END LOOP;
END;
